-- Volcando estructura para procedimiento crm_magna.GenerateLogs
DELIMITER //
CREATE PROCEDURE `GenerateLogs`()
BEGIN
    SET @current_date = NOW();
    SET @users = 'Admin,direccion,informatica,marketing,Facturacion,Gerencia,Comercial,Almacen,Gestion,Pedidos';
    SET @domain = 'fabricandoeventosjerez.com';

    WHILE @current_date >= DATE_SUB(NOW(), INTERVAL 6 MONTH) DO
        -- Selección aleatoria de al menos 7 usuarios para iniciar sesión en el día actual
        SET @selected_users = '';
        SET @selected_emails = '';
        SET @num_users = FLOOR(7 + (RAND() * 4)); -- Entre 7 y 10 usuarios
        WHILE @num_users > 0 DO
            SET @user_index = FLOOR(0 + (RAND() * 10));
            SET @current_user = SUBSTRING_INDEX(SUBSTRING_INDEX(@users, ',', @user_index + 1), ',', -1);
            SET @current_email = CONCAT(@current_user, '@', @domain);

            IF LOCATE(CONCAT(',', @current_user, ','), @selected_users) = 0 THEN
                -- El usuario no ha sido seleccionado previamente
                SET @selected_users = CONCAT(@selected_users, @current_user, ',');
                SET @selected_emails = CONCAT(@selected_emails, @current_email, ',');
                SET @num_users = @num_users - 1;
            END IF;
        END WHILE;

        -- Generar registros para los usuarios seleccionados con hora de acceso aleatoria dentro de las 9 AM
        WHILE LENGTH(@selected_users) > 0 DO
            SET @current_user = SUBSTRING_INDEX(@selected_users, ',', 1);
            SET @current_email = SUBSTRING_INDEX(@selected_emails, ',', 1);

            -- Eliminar al usuario seleccionado de la lista
            SET @selected_users = SUBSTRING(@selected_users, LENGTH(@current_user) + 2);
            SET @selected_emails = SUBSTRING(@selected_emails, LENGTH(@current_email) + 2);

            -- Generar una hora de acceso aleatoria dentro de las 9 AM
            SET @current_hour = 9;
            SET @current_minute = FLOOR(4 + (RAND() * 12)); -- Entre 4 y 15 minutos
            SET @current_second = FLOOR(0 + (RAND() * 60));
            SET @current_time = CONCAT(DATE(@current_date), ' ', LPAD(@current_hour, 2, '0'), ':', LPAD(@current_minute, 2, '0'), ':', LPAD(@current_second, 2, '0'));

            VALUES (43, 'login', @current_user, @current_email, CONCAT('Login del usuario con el nombre: ', @current_user), 'EDUCACION OCIO Y TIEMPO LIBRE LA FABRICA SL', @current_time, @current_time, @current_time);
        END WHILE;

        SET @current_date = DATE_SUB(@current_date, INTERVAL 1 DAY);
    END WHILE;
END//
DELIMITER ;

